import React from 'react';
import Link from 'next/link';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';

export default function Signup() {
  const app = css`
    background: #ffc0cb;
    min-height: 100vh;
    font-weight: 400;
    font-family: 'sans-serif';
    width: 100%;
    position: absolute;
  `;
  const form = css`
    background: #2f4f4f;
    width: 15%;
    height: 50%;
    position: relative;
    margin: auto;
    margin-top: 20%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 20px;
    border-radius: 6px;
  `;

  const input = css`
    line-height: 2.5;
    margin-bottom: 15px;
    border-radius: 4px;
    border: 4px solid #ffc0cb;
  `;

  return (
    <>
      <div css={app}>
        <form css={form}>
          <input css={input} placeholder="Name" type="text" required="" />
          <input
            css={input}
            placeholder="Email"
            type="email"
            name="customerEmail"
          />
          <input
            css={input}
            placeholder="Password"
            type="password"
            name="customerPassword"
            pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
          />
          <button type="button"> SIGN UP</button>
        </form>
      </div>
    </>
  );
}
